ing // Template-ul cu placeholdere {businessName}, {specificMention}, etc.\n  description String?\n  isActive    Boolean @default(true)\n  usageCount  Int     @default(0)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relații\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@map(\"response_templates\")\n}\n\n// Modelul pentru utilizarea lunară\nmodel Usage {\n  id           String @id @default(cuid())\n  userId       String\n  month        Int\n  year         Int\n  requestCount Int    @default(0)\n\n  // Relații\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  // Index compus pentru căutări rapide\n  @@unique([userId, month, year])\n  @@map(\"usage\")\n}\n\n// Modelul pentru logarea apelurilor API\nmodel ApiCall {\n  id     String @id @default(cuid())\n  userId String\n\n  // Detalii cerere\n  reviewText   String\n  responseText String\n  language     String\n  tone         String\n  model        String  @default(\"gpt-4\")\n  businessType String? // tipul de business folosit\n  templateId   String? // template-ul folosit dacă este cazul\n\n  // Metadata\n  tokensUsed   Int?\n  cost         Float? // în USD\n  duration     Int? // în milisecunde\n  success      Boolean @default(true)\n  errorMessage String?\n\n  createdAt DateTime @default(now())\n\n  // Relații\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@map(\"api_calls\")\n}\n\n// Modelul pentru feedback utilizatori\nmodel Feedback {\n  id      String  @id @default(cuid())\n  email   String?\n  subject String\n  message String\n  type    String  @default(\"general\") // bug, feature, general\n  status  String  @default(\"open\") // open, in_progress, closed\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"feedback\")\n}\n\n// Modelul pentru setările sistem\nmodel SystemSetting {\n  id    String @id @default(cuid())\n  key   String @unique\n  value String\n\n  updatedAt DateTime @updatedAt\n\n  @@map(\"system_settings\")\n}\n",
